INSERT INTO `HedgeFundInformation` (`HFIId`, `NatureOfHedgeFund`, `Principles`, `Vision`, `InvestmentRange`, `Address`, `Country`, `Telephone`, `Website`, `OrganisationId`, `IndustryId`) VALUES
(1, 'A hedge fund is an investment fund that trades in relatively liquid assets and is able to make extensive use of more complex trading, portfolio-construction and risk management techniques to improve performance, such as short selling, leverage, and derivatives. Because of its use of complex techniques, financial regulators typically do not allow hedge funds to be marketed or made available to anyone except institutional investors, high net worth individuals and other investors who are considered sufficiently sophisticated, such as being an accredited investor. Hedge funds are regarded as alternative investments.', 'In Principles, Dalio shares what he’s learned over the course of his remarkable career. He argues that life, management, economics, and investing can all be systemized into rules and understood like machines. The book’s hundreds of practical lessons, which are built around his cornerstones of “radical truth” and “radical transparency,” include Dalio laying out the most effective ways for individuals and organizations to make decisions, approach challenges, and build strong teams. He also describes the innovative tools the firm uses to bring an idea meritocracy to life, such as creating “baseball cards” for all employees that distill their strengths and weaknesses, and employing computerized decision-making systems to make believability-weighted decisions. While the book brims with novel ideas for organizations and institutions, Principles also offers a clear, straightforward approach to decision-making that Dalio believes anyone can apply, no matter what they’re seeking to achieve.', 'The Trustee of the Trust is Philadelphia Investment Credit Union & Capital Trust, a Delaware statutory trust wholly owned by Oderli Feriani. The Trustee will manage the day-to-day affairs of the Trust. The Trustee, located in Philadelphia, Pennsylvania, will perform all general administrative tasks for the Trust, including the keeping of the financial records, and preparation of informational returns and reports to Shareholders. The Trustee will receive a fee for its services. See “Compensation”. However, without notice to the Shareholders, our Trustee may retain other or additional service providers to perform the administrative services that would otherwise be performed by our Trustee. The Trustee was formed to provide administrative and other services in connection with the Trust.', 'R100 000 - R100 000 000', 'Westrand, Johannesburg, 0001', 'South Africa', '0123456789', 'www.hedgefund.co.za', 1, 4);

