--
-- Table structure for table `NewsArticles`
--

CREATE TABLE `NewsArticles` (
  `ArticleId` bigint(20) NOT NULL,
  `Heading` varchar(100) DEFAULT NULL,
  `Article` text DEFAULT NULL,
  `Author` varchar(100) DEFAULT NULL,
  `Banner` varchar(250) DEFAULT NULL,
  `ChannelId` bigint(20) DEFAULT NULL,
  `TopicId` bigint(20) DEFAULT NULL,
  `PublishedDate` datetime DEFAULT current_timestamp(),
  `DisplayInd` int(11) DEFAULT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;

