(1, 'Takealot.com (styled takealot.com[1]) is a South African e-commerce company based in Cape Town, South Africa. As the country s largest online retailer[2][3], takealot.com has helped grow online shopping in South Africa[4][5][6], and was the first local retailer to take part in Black Friday.[7][8]As of November 2019, over 2500 third-party businesses use the Takealot Marketplace platform to sell to over 1.8 million takealot.com shoppers.', 'Johannesburg', 'South Africa', 'www.takealot.com', '01234567890', 1, 2),
(2, 'The etymology of gibberish is uncertain. The term was first seen in English in the early 16th century.[4] It is generally thought to be an onomatopoeia imitative of speech, similar to the words jabber (to talk rapidly) and gibber (to speak inarticulately).[5][6]\r\n\r\nIt may originate from the word jib, which is the Angloromani variant of the Romani language word meaning \"language\" or \"tongue\". To non-speakers, the Anglo-Romany dialect could sound like English mixed with nonsense words, and if those seemingly-nonsensical words are referred to as jib then the term gibberish (pronounced \"jibberish\") could be derived as a descriptor for nonsensical speech. Another theory is that gibberish came from the name of a famous 8th century Muslim Persian alchemist, Jābir ibn Hayyān, whose name was Latinized as Geber. Thus, gibberish was a reference to the incomprehensible technical jargon and allegorical coded language used by Jabir and other alchemists.[7][8][9][10]\r\n\r\nA discredited alternative theory asserts that it is derived from the Irish word gob or gab (\"mouth\")[11] or from the Irish phrase Geab ar ais (\"back talk, backward chat\").[12] The latter Irish etymology was suggested by Daniel Cassidy, whose work has been criticised by linguists and scholars.[13][14][15] The terms geab and geabaire are certainly Irish words, but the phrase geab ar ais does not exist, and the word gibberish exists as a loan-word in Irish as gibiris.[16]\r\n\r\nThe term gobbledygook was coined by Maury Maverick, a former congressman from Texas and former mayor of San Antonio.[17] When Maverick was chairman of the Smaller War Plants Corporation during World War II, he sent a memorandum that said: \"Be short and use plain English. ... Stay off gobbledygook language.\"[18][19] Maverick defined gobbledygook as \"talk or writing which is long, pompous, vague, involved, usually with Latinized words.\" The allusion was to a turkey, \"always gobbledygobbling and strutting with ridiculous pomposity.\"[20][21] ', 'City', 'Country', 'www.companywebsite.com', '01234567890', 11, 5);

